import React, { Component } from 'react'
import MY_SERVICE from '../../services/index'

export default class CreateNew extends Component {
    state={
        center: {
            empresa: "",
            email: "",

            address: "",
            horario: "",
            contactNumber: "",
            tipoResiduo: "",
        }
    }
    render() {
        return (
            <div>
                <p>Aqui podras agregar un nuevo centro</p>
            </div>
        )
    }
}
